var original = this.getObjectByName( 'particle' );

var original02 = this.getObjectByName( 'particle2' );


var particles = [];

for ( var i = 0; i < 50; i ++ ) {

	var particle = original.clone();
	particle.userData.velocity = new THREE.Vector3();
	particle.position.add( new THREE.Vector3((Math.random() - 0.5) * 100,(Math.random() - 0.5) * 10,(Math.random() - 0.5) * 10 )); 
	particle.scale.add( new THREE.Vector3((Math.random() - 0.5) * 10,(Math.random() - 0.5) * 10,(Math.random() - 0.5) * 10 ));

	this.add( particle );
	particles.push( particle );

}



function update( event ) {

	var particle = particles.shift();
	particles.push( particle );

	var velocity = particle.userData.velocity;
	//velocity.x = Math.random() * 0.1 - 0.05;
	//velocity.y = Math.random() * 0.1 + 0.1;
	//velocity.z = Math.random() * 0.1 - 0.05;

	for ( var i = 0; i < particles.length; i ++ ) {

		var particle = particles[ i ];

		var velocity = particle.userData.velocity;

		velocity.y -=  (Math.random() * 0.1 - 0.05)*0.01;

		velocity.x += (Math.random() * 0.1 - 0.05)*0.01;

		particle.position.add( velocity );



	}

}
